import { useEffect, useState } from 'react'
import users from '../api/users';

const useAuth = () => {

    const [auth, setAuth] = useState({});

    useEffect(() => {

        users.get('/api/checkLogin').then(res => {
            setAuth(res)
            console.log(res);
        }).catch(err => {
            console.log(err);
        });

    }, []);

    return (
        auth
    )
}

export default useAuth
